import { GoogleLogin } from '@react-oauth/google';

export default function Login({ onSuccess }) {
  return (
    <div className="login-container">
      <h2>Login with Google</h2>
      <GoogleLogin
        onSuccess={(credentialResponse) => {
          onSuccess(credentialResponse);
        }}
        onError={() => {
          console.log('Login Failed');
        }}
      />
    </div>
  );
}
